window.bookSummaryJSON = "<p>Beloved by millions, this timeless classic holds the key to all you desire and everything you wish to accomplish. This is the book that reveals the secret to personal wealth.</p> <p>Countless readers have been helped by the famous \"Babylonian parables,\" hailed as the greatest of all inspirational works on the subject of thrift, financial planning, and personal wealth. In language as simple as that found in the Bible, these fascinating and informative stories set you on a sure path to prosperity and its accompanying joys. Acclaimed as a modern-day classic, this celebrated bestseller offers an understanding of - and a solution to - your personal financial problems that will guide you through a lifetime. This is the book that holds the secrets to keeping your money - and making more.</p>"; 
